import React from 'react';
import { Link } from 'react-router-dom';
import '../styles/components/navigation.css'; // Adjust the path as necessary

const Navigation = () => {
    return (
        <nav className="navigation">
            <div className="logo">
                <Link to="/">Career Guidance</Link>
            </div>
            <ul>
                <li><Link to="/">Trang chủ</Link></li>
                <li><Link to="/search/schools">Trường học</Link></li>
                <li><Link to="/search?type=major">Ngành học</Link></li>
                <li><Link to="/search?type=scores">Điểm chuẩn</Link></li>
                <li><Link to="/search?type=careers">Nghề nghiệp</Link></li>
                <li><Link to="/login">Đăng nhập</Link></li>
            </ul>
        </nav>
    );
};

export default Navigation;
